  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113909 includes chemical,
  discrete sample, physical and profile data collected from HEALY in the Baffin Bay
  and Lincoln Sea from 2003-07-21 to 2003-08-16 and retrieved during cruise CARINA_HLY-0301.
  These data include ALKALINITY, AMMONIUM, Barium, CHLOROFLUOROCARBON-11 (CFC-11),
  CHLOROFLUOROCARBON-12 (CFC-12), Carbon tetrachloride (CCL4), DISSOLVED INORGANIC
  CARBON, DISSOLVED OXYGEN, Delta Oxygen - 18, HYDROSTATIC PRESSURE, NITRATE, NITRITE,
  PHOSPHATE, SALINITY, SILICATE and WATER TEMPERATURE. The instruments used to collect
  these data include CTD and bottle. These data were collected by Kumiko Azetsu-Scott
  of Bedford Institute of Oceanography and Kelly Kenison Falkner of Oregon State University;
  College of Earth, Ocean, and Atmospheric Sciences as part of the CARINA_HLY-0301
  data set.nnThe CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project
  is an international collaborative effort of the EU IP CARBOOCEAN, and U.S. partners.
  It has produced a merged internally consistent data set of open ocean subsurface
  measurements for biogeochemical investigations, in particular, studies involving
  the carbon system. The original focus area was the North Atlantic Ocean, but over
  time the geographic extent expanded and CARINA now includes data from the entire
  Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
